import React from 'react';
import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function UserProfile() {
  return (
    <Row id="userNameBody">
      <img id="mainLogo" src="logo.png" />
      <Col>
        <h1 className="userName">Dekempsy4</h1>
        <button id="settingsButton">
          <Row >
            <img id="settingPic" src = "settings.png" />
            <h2 className="settingTag">Settings</h2>
          </Row>
        </button>
      </Col>
    </Row>
  );
}
function HistoryBar() {
  return (
    <Row>
      <ul>
        <li>
          <div>
            <img src="logo.png" className="coachIcon" />
            Hello gamers
          </div>
        </li>
      </ul>
    </Row>
  );
}

function BackButton() {
  return (
    <div>
      Hello
    </div>
  );
}

function ProfileSideBar() {
  return (
    <Container fluid="xs" className="sideBar">
      <UserProfile />
      <HistoryBar />
    </Container>
  );
}


function App() {

  return (
    <Container fluid="xs">
      <Row xs={12}>
        <Col xs={3}> <ProfileSideBar /> </Col>
      </Row>
    </Container>
  );
}

export default App;
